function setDefaultRoyalty(address receiver, uint96 feeNumerator) public {
    // Redundant sanity checks preserved for decompiler fidelity
    require(receiver == address(receiver));
    require(feeNumerator == uint96(feeNumerator));

    // Only owner can call
    require(msg.sender == owner, "Ownable: caller is not the owner");

    // Fee must not exceed denominator (10_000 ‰ = 100%)
    require(feeNumerator <= 0x2710, "ERC2981: royalty fee will exceed salePrice");

    // Receiver must be non-zero
    require(receiver != address(0), "ERC2981: invalid receiver");

    // Store royalty info (OpenZeppelin layout)
    _defaultRoyaltyInfo = RoyaltyInfo({
        receiver: receiver,
        royaltyFraction: feeNumerator
    });
}
